ationDoc_Sheets_Formulas_ParamDescExample_LENB:'LENB("你好")',CreationDoc_Sheets_Formulas_FormulasDesc_LENB:"返回给定文本的字符数。",CreationDoc_Sheets_Formulas_ParamDesc01_LENB:"输入要确定其字符数的文本（空格将作为字符进行计数）",CreationDoc_Sheets_Formulas_ParamName01_LENB:"文本",LarkCCM_Sheets_LINEST_FormulaExample:"LINEST(B2:B10, A2:A10, FALSE, TRUE)",LarkCCM_Sheets_LINEST_FormulaDescription:"通过最小二乘法最佳拟合线性趋势",LarkCCM_Sheets_LINEST_ParameterDescription_KnownDataY:"包含已知因变量(y)数据值的数组或范围，用于拟合理想的线性趋势曲线。如果已知数据_y为一维数组或范围，已知数据_x则可代表二维数组或范围中的多个自变量。也就是说，如果已知数据_y为单行，则将已知数据_x中的每行解释为各自独立的值，类似情况也适用于已知数据_y为单列的情况。这种为多元线性回归场景。",LarkCCM_Sheets_LINEST_ParameterDescription_KnownDataX:"对应于“已知数据_y”的自变量值",LarkCCM_Sheets_LINEST_ParameterDescription_CalculateB:"给定曲线拟合的一般指数形式：y = m*x+b，如果此参数为TRUE则计算b，而若为FALSE则令b为 0，并且仅计算m值，即强制曲线拟合经过原点。当为多元线性回归场景时，给定曲线拟合的一般指数形式 y = m1x1 + m2x2 + ... + b，根据公式 w = ((X_T * X)-1) * (X_T * Y) 得到斜率和截距，其中 _T 表示矩阵转置，-1 表示矩阵求逆，当矩阵 XT * X 不可逆时，通过 SVD 分解求伪逆。",LarkCCM_Sheets_LINEST_ParameterDescription_Verbose:"此标志指示的是，要返回其他回归统计数据还是仅返回线性系数和y轴截距（默认）",LarkCCM_Sheets_LINEST_ParameterName_KnownDataY:"已知数据_y",LarkCCM_Sheets_LINEST_ParameterName_KnownDataX:"已知数据_x",LarkCCM_Sheets_LINEST_ParameterName_CalculateB:"计算_b",LarkCCM_Sheets_LINEST_ParameterName_Verbose:"详细",CreationDoc_Sheets_Formulas_ParamDescExample_LN:"LN(100)",CreationDoc_Sheets_Formulas_FormulasDesc_LN:"返回数值以 e（欧拉数）为底的对数。",CreationDoc_Sheets_Formulas_ParamDesc01_LN:"要计算其以 e 为底的对数的数值。",CreationDoc_Sheets_Formulas_ParamName01_LN:"数值",CreationDoc_Sheets_Formulas_ParamDescExample_LOG:"LOG(128, 2)",CreationDoc_Sheets_Formulas_FormulasDesc_LOG:"返回数值以指定数为底的对数。",CreationDoc_Sheets_Formulas_ParamDesc01_LOG:"要计算其对数的数值。",CreationDoc_Sheets_Formulas_ParamDesc02_LOG:"用于计算此对数的底数。",CreationDoc_Sheets_Formulas_ParamName01_LOG:"数值",CreationDoc_Sheets_Formulas_ParamName02_LOG:"底数",CreationDoc_Sheets_Formulas_ParamDescExample_LOG10:"LOG10(10)",CreationDoc_Sheets_Formulas_FormulasDesc_LOG10:"返回数字以 10 为底的对数。",CreationDoc_Sheets_Formulas_ParamDesc01_LOG10:"想要计算其以 10 为底的对数的正实数。",CreationDoc_Sheets_Formulas_ParamName01_LOG10:"数值",LarkCCM_Sheets_LOGEST_FormulaExample:"LOGEST(B2:B10, A2:A10, TRUE, TRUE)",LarkCCM_Sheets_LOGEST_FormulaDescription:"计算最佳拟合的指数增长曲线",LarkCCM_Sheets_LOGEST_ParameterDescription_KnownDataY:"包含已知因变量 (y) 数据值的数组或范围，用于拟合理想的指数增长曲线。如果已知数据_y为一维数组或范围，已知数据_x则可代表二维数组或范围中的多个自变量。也就是说，如果已知数据_y为单行，则将已知数据_x中的每行解释为各自独立的值，类似情况也适用于已知数据_y为单列的情况。这种为多元线性回归场景",LarkCCM_Sheets_LOGEST_ParameterDescription_KnownDataX:"对应于“已知数据_y”的自变量值",LarkCCM_Sheets_LOGEST_ParameterDescription_B:"给定拟合曲线的一般指数形式y = b*m^x，如果此参数为 TRUE，计算 b 的值，若此参数为 FALSE，则将 b 设为 1 而仅计算 m 值。当为多元线性回归场景时，给定曲线拟合的一般指数形式 y = b*m1^x1*...*mn^xn，根据公式 w = ((X_T * X)-1) * (X_T * ln(Y)) 得到ln(m)和ln(b)，其中 _T 表示矩阵转置，-1 表示矩阵求逆，ln(Y) 表示已知 Y 求对数。当矩阵 X_T * X 不可逆时，通过 SVD 分解求伪逆。",LarkCCM_Sheets_LOGEST_ParameterDescription_Verbose:"用于指示要返回其他回归统计数据还是仅返回系数和指数的标志",LarkCCM_Sheets_LOGEST_ParameterName_KnownDataY:"已知数据_y",LarkCCM_Sheets_LOGEST_ParameterName_KnownDataX:"已知数据_x",LarkCCM_Sheets_LOGEST_ParameterName_B:"b",LarkCCM_Sheets_LOGEST_ParameterName_Verbose:"详细",CreationDoc_Sheets_Formulas_ParamDescExample_LOOKUP:"LOOKUP(10003, A1:A100, B1:B100)",CreationDoc_Sheets_Formulas_FormulasDesc_LOOKUP:"在已排序的行或列中查找某个键值，并返回结果范围内与该键值位置（即该键值在搜索行或列中的位置）相同的单元格的值。",CreationDoc_Sheets_Formulas_ParamDesc01_LOOKUP:"要在行或列中搜索的值。",CreationDoc_Sheets_Formulas_ParamDesc02_LOOKUP:"使用此函数的一种方法是指定已排序的单行或单列作为“搜索范围”（第一个参数）以查找“搜索键值”。这种方法要用到第二个参数“结果范围”。另一种方法是将这两个参数合并为一个“搜索和结果数组”，其中第一行或第一列用于搜索，并返回该数组的最后一行或最后一列中相应位置的值。如果系统找不到“搜索键值”，则可能会返回不完全匹配的结果。",CreationDoc_Sheets_Formulas_ParamDesc03_LOOKUP:"返回结果的范围。返回值与在“search_range”中找到“search_key”的位置对应。此范围必须仅为单行或单列，而如果您使用的是search_result_array方式，则不应提供此参数。",CreationDoc_Sheets_Formulas_ParamName01_LOOKUP:"搜索键值",CreationDoc_Sheets_Formulas_ParamName02_LOOKUP:"搜索范围 | 搜索结果数组",CreationDoc_Sheets_Formulas_ParamName03_LOOKUP:"结果范围",CreationDoc_Sheets_Formulas_ParamDescExample_LOWER:'LOWER("LOREM IPSUM")',CreationDoc_Sheets_Formulas_FormulasDesc_LOWER:"将指定字符串中的字母转换为小写。",CreationDoc_Sheets_Formulas_P